import "fmt"

func Print(values ...interface{}) {
	for _, v := range values {
		fmt.Println(v)
	}
}

func Sum(numbers ...int) int {
	total := 0
	for _, n := range numbers {
		total = (total + n)
	}
	return total
}

func PrintLabeled(label string, items ...string) {
	fmt.Println(label)
	for _, item := range items {
		fmt.Print("  - ")
		fmt.Println(item)
	}
}

